/* tslint:disable */
/* eslint-disable */
/**
 * Project API
 * API for config.json in project
 */

import { exists, mapValues } from '../runtime';
/**
 * 
 * @export
 * @interface Object
 */
export interface Object {
    /**
     * none
     * @type {string}
     * @memberof Object
     */
    id: string;
    /**
     * none
     * @type {string}
     * @memberof Object
     */
    description: string;
    /**
     * none
     * @type {string}
     * @memberof Object
     */
    value: string;
}

export function ObjectFromJSON(json: any): Object {
    return ObjectFromJSONTyped(json, false);
}

export function ObjectFromJSONTyped(json: any, ignoreDiscriminator: boolean): Object {
    if ((json === undefined) || (json === null)) {
        return json;
    }
    return {

        'id': json['id'],
        'description': json['description'],
        'value': json['value'],
    };
}

export function ObjectToJSON(value?: Object | null): any {
    if (value === undefined) {
        return undefined;
    }
    if (value === null) {
        return null;
    }
    return {

        'id': value.id,
        'description': value.description,
        'value': value.value,
    };
}
